import {
  Box,
  Button,
  Container,
  TextField,
  Typography,
} from "@material-ui/core";
import React, { Component } from "react";

class SignIn extends Component {
  constructor(props){
    super(props);
    this.state={
        credentials:{
            taiKhoan:"",
            matKhau:""
        }
    }
  }
  handleChange=(e)=>{
      e.p
  }
  render() {
    return (
      <div>
        <Container maxWidth="sm">
          <Typography component="h1" variant="h2">
            Sign In
          </Typography>
          <form>
            <Box my={3}>
              <TextField
               name="taiKhoan" onC variant="outlined" label="UserName" fullWidth />
            </Box>
            <Box my={3}>
              <TextField
                variant="outlined"
                label="PassWord"
                type="password"
                fullWidth
              />
            </Box>
            <Box textAlign="center">
              <Button type="submit" variant="contained" color="primary">
                Submit
              </Button>
            </Box>
          </form>
        </Container>
      </div>
    );
  }
}

export default SignIn;
